// Input: items[0].json.output is a string containing JSON
// Output: parsed and cleaned JSON fields
return items.map(item => {
  let data = {};
  try {
    // Parse the string inside "output"
    data = JSON.parse(item.json.output);
  } catch (e) {
    throw new Error("Failed to parse AI output: " + e.message);
  }
  return { json: data };
});

